INSERT INTO `updates` (`update_id`, `project_id`, `update_title`, `update_timestamp`, `update_description`) VALUES
(1, 1, 'I made homemade chocolate chip cookies for our classroom holiday party. They were well received.', '2018-03-23 09:05:38', '16 days, $8,465, 87 donors and now just 24 hours left to give! Thank you to those who have supported the campaign. Initial estimates on the bathroom repairs and library look higher than expected, so we’ll need all the help we can get. '),
(2, 1, 'After eight days and 57 generous contributions our fundraising campaign has reached its $5,000 goal. ', '2018-03-23 09:07:53', 'I’m humbled, grateful, and excited to put the money to use to help improve Kailash. Principal Mitra and I already have a date next Friday to go fan shopping, I’m pumped. As I mentioned in my original post, the items listed in the fundraiser represented only a portion of the many things Kailash needs. Since there has been such incredible momentum behind this campaign, I want to raise the fundraising goal to $7,500 in hopes that we will be able to provide additional crucial upgrades to the school. Next up on Kailash’s wish list are art supplies, money for field trips, and dorm improvements. I’ll post more detailed descriptions about these wish list items in the coming days, but for now let’s celebrate today’s amazing achievement!'),
(3, 1, 'I’m happy to report that we’ve now blown past my original fundraising goal and are currently sitting at $6,738 thanks to 72 amazing people. ', '2018-03-23 09:06:55', 'From my first day of class my students have asked me questions about American food. I\'ve showed them photos of bagels, pancakes and milkshakes, but a few weeks ago I arranged to take a group of students on a field trip to Sienna Café to try some “American” fare themselves. A major thank you to Shuli and the amazing Sienna staff for taking such good care of us—we sampled strawberry smoothies, grilled cheese sandwiches, French fries, pizza, and avocado salad. After a tightly contested vote my students awarded first prize to the strawberry smoothies with French fries coming in a close second. Avocado salad proved to be the most polarizing item we ate. A few students told me afterwards that the avocado was their new favorite fruit while others picked at their salad while making faces of disgust.\r\n\r\nOver the past few months, I’ve led my students on a number of field trips and have seen how beneficial it is to expose them to new environments and experiences. Apart from a yearly government-sponsored picnic, my students currently do not have many opportunities to leave Chetla, the community where Kailash is located. With the additional money we are raising through the fundraiser, we will be able to fund trips to museums, parks, and events that my students would otherwise not have access to.');

